      "caption": "╨б╤Г╨┐╨╡╤А╤Д╨╕╨╜╨░╨╗!\n\n╨б 9 ╨┐╨╛ 11 ╨╝╨░╤П ╨▓ ╨│╨╛╤А╨╛╨┤╨╡ ╨е╤А╨╛╨╝╤В╨░╤Г ╨┐╤А╨╛╤И╨╡╨╗ ╨│╤А╨░╨╜╨┤╨╕╨╛╨╖╨╜╤Л╨╣ ╤Д╨╕╨╜╨░╨╗ ╤Б ╤Г╤З╨░╤Б╤В╨╕╨╡╨╝ 18╤В╨╕ ╨║╨╛╨╝╨░╨╜╨┤ ╨Ъ╨░╨╖╨░╤Е╤Б╤В╨░╨╜╨░!\n╨Ь╨░╤Б╤И╤В╨░╨▒╨╜╨╛╨╡ ╤Б╨╛╨▒╤Л╤В╨╕╨╡ ╨╜╨░ ╨┐╨░╤А╨║╨╡╤В╨╡ ╨╜╨░╤И╨╡╨│╨╛ ╤А╨╛╨┤╨╜╨╛╨│╨╛ ╨д╨Ю╨Ъ╨░ ╨╜╨╡ ╨╛╤Б╤В╨░╨╗╨╛╤Б╤М ╨╜╨╡╨╖╨░╨╝╨╡╤З╨╡╨╜╨╜╤Л╨╝.\n\n╨е╨╛╤В╨╕╨╝ ╨▓╤Л╤А╨░╨╖╨╕╤В╤М ╨╛╨│╤А╨╛╨╝╨╜╤Г╤О ╨▒╨╗╨░╨│╨╛╨┤╨░╤А╨╜╨╛╤Б╤В╤М ╨Р╨║╨╕╨╝╤Г ╨Р╨║╤В╤О╨▒╨╕╨╜╤Б╨║╨╛╨╣ ╨╛╨▒╨╗╨░╤Б╤В╨╕ ╨и╨░╤Е╨░╤А╨╛╨▓╤Г ╨Р╤Б╤Е╨░╤В╤Г ╨С╨╡╤А╨╗╨╡╤И╨╡╨▓╨╕╤З╤Г  ╨╖╨░ ╨▓╨╜╨╕╨╝╨░╨╜╨╕╨╡ ╨║ ╨▒╨░╤Б╨║╨╡╤В╨▒╨╛╨╗╤Г ╨▓ ╨╜╨░╤И╨╡╨╝ ╤А╨╡╨│╨╕╨╛╨╜╨╡!\n╨б╨░╨╝╨╛╨╗╨╕╤З╨╜╨╛ ╨┐╤А╨╕╨╡╤Е╨░╨╗ ╨╕ ╨┐╨╛╨╢╨╡╨╗╨░╨╗ ╨╜╨░╤И╨╕╨╝ ╤Б╨┐╨╛╤А╤В╤Б╨╝╨╡╨╜╨░╨╝ ╤Г╤Б╨┐╨╡╤Е╨╛╨▓!\n╨Т╤Л╤А╨░╨╢╨░╨╡╨╝ ╨▒╨╗╨░╨│╨╛╨┤╨░╤А╨╜╨╛╤Б╤В╤М ╨┐╤А╨╛╨╡╨║╤В╤Г ╨Р╨╗╨╢╨░╨╜, ╨║╨╛╤В╨╛╤А╤Л╨╡ ╨▓╤Л╨▒╤А╨░╨╗╨╕ ╨╜╨░╤И ╤А╨╡╨│╨╕╨╛╨╜ ╨╜╨░ ╨┐╤А╨╛╨▓╨╡╨┤╨╡╨╜╨╕╨╡ ╤Б╤Г╨┐╨╡╤А╤Д╨╕╨╜╨░╨╗╨░! \n╨Ю╤В╨┤╨╡╨╗╤М╨╜╨░╤П ╨▒╨╗╨░╨│╨╛╨┤╨░╤А╨╜╨╛╤Б╤В╤М - ╨и╨░╨║╨╕╤А╨╛╨▓╤Г ╨Ь╨░╤А╨░╤В╤Г ╨б╨░╨│╨╕╨┤╨╛╨▓╨╕╤З╤Г!\n╨в╨░╨║╨╢╨╡ ╨▓╤Л╤А╨░╨╢╨░╨╡╨╝ ╨▒╨╗╨░╨│╨╛╨┤╨░╤А╨╜╨╛╤Б╤В╤М ╨Р╤Е╤В╨░╨╜╨╛╨▓╤Г ╨Х╤А╨╗╨░╨╜╤Г ╨Ъ╨╛╨║╨╡╨╜╨░╨╡╨▓╨╕╤З╤Г ╨╖╨░ ╨┐╨╛╨┤╨┤╨╡╤А╨╢╨║╤Г ╨╕ ╤А╨░╨╖╨▓╨╕╤В╨╕╨╡ ╨▒╨░╤Б╨║╨╡╤В╨▒╨╛╨╗╨░ ╨▓ ╨│╨╛╤А╨╛╨┤╨╡ ╨е╤А╨╛╨╝╤В╨░╤Г.\n╨Э╤Г ╨╕,╨║╨╛╨╜╨╡╤З╨╜╨╛ ╨╢╨╡, ╨┐╤А╨░╨╖╨┤╨╜╨╕╨║ ╨▒╨░╤Б╨║╨╡╤В╨▒╨╛╨╗╨░ ╨╜╨╡ ╤Б╨╛╤Б╤В╨╛╤П╨╗╤Б╤П ╨▒╤Л ╨▒╨╡╨╖ ╨╕╨╜╨╕╤Ж╨╕╨░╤В╨╕╨▓╨╜╨╛╨╣ ╨│╤А╤Г╨┐╨┐╤Л ╨▓ ╨╗╨╕╤Ж╨╡ ╨Ь╨╕╤В╤А╨╛╤Д╨░╨╜╨╛╨▓╨╛╨╣ ╨Х╨╗╨╡╨╜╤Л ╨Р╨╗╨╡╨║╤Б╨░╨╜╨┤╤А╨╛╨▓╨╜╤Л.\n╨Ш ╨╛╤Б╨╛╨▒╨╡╨╜╨╜╨░╤П ╨▒╨╗╨░╨│╨╛╨┤╨░╤А╨╜╨╛╤Б╤В╤М ╨╜╨░╤И╨╡╨╝╤Г ╨│╨╗╨░╨▓╨╜╨╛╨╝╤Г ╤Б╨┐╨╛╨╜╤Б╨╛╤А╤Г - ╨║╨╛╨╝╨┐╨░╨╜╨╕╨╕ ERG!\n╨б╨┐╨░╤Б╨╕╨▒╨╛ ╨▓╨░╨╝ ╨╖╨░ ╤В╨╛, ╤З╤В╨╛ ╨▓╤Л ╨┤╨╡╨╗╨░╨╡╤В╨╡ ╨┤╨╗╤П ╨▒╨░╤Б╨║╨╡╤В╨▒╨╛╨╗╨░ ╨▓ ╨╜╨░╤И╨╡╨╝ ╤А╨╡╨│╨╕╨╛╨╜╨╡!\n__________________________________________\n\n@alzhan.league \n@ofkkhromtaudgok \n@hromtau_audanynyn_akimdigi \n@elenamit_",
